/*Table structure for table `UserLike` */

DROP TABLE IF EXISTS `UserLike`;

CREATE TABLE `UserLike` (
  `user_id` int(10) unsigned zerofill NOT NULL,
  `music_id` int(10) unsigned zerofill NOT NULL,
  PRIMARY KEY (`user_id`,`music_id`),
  KEY `music_id` (`music_id`),
  CONSTRAINT `UserLike_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `UserInfo` (`user_id`) ON DELETE CASCADE,
  CONSTRAINT `UserLike_ibfk_2` FOREIGN KEY (`music_id`) REFERENCES `SongInfo` (`music_id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

